import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Importa el archivo CSS de Bootstrap
import { Container, Navbar, Nav } from 'react-bootstrap'; // Importa los componentes de Bootstrap que necesitas
import './css/Usuarios.css'; // Asegúrate de crear este archivo para tus estilos personalizados

function Usuarios() {
  return (
    <div className="app">
      <Navbar bg="dark" variant="dark" expand="lg" fixed="top">
        <Navbar.Brand href="#home">Mi Aplicación</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#inicio">Inicio</Nav.Link>
          <Nav.Link href="#acerca-de">Acerca de</Nav.Link>
          <Nav.Link href="#contacto">Contacto</Nav.Link>
        </Nav>
      </Navbar>
      <div className="content">
        <h1>Contenido Principal</h1>
        {/* Aquí puedes añadir más contenido */}
      </div>
    </div>
  );
}

export default Usuarios;
